import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App(){

    const workers = [
        {name: 'Samuel', surname: 'Jacson', count: 20, salary: 130},
        {name: 'Jam', surname: 'Luise', count: 23, salary: 110},
        {name: 'Katy', surname: 'Smitt', count: 20, salary: 100},
        {name: 'Julia', surname: 'Krosbi', count: 22, salary: 140},
        {name: 'Sam', surname: 'Venson', count: 22, salary: 160}
    ]


    return(
        <div>
            <table>
                <tbody>
                    {workers.map(iitem => {
                        <td>{iitem.name}{iitem.surname}</td>
                    })}

                </tbody>
            </table>
        </div>
        )

}

export default App;
